import React, { useState } from 'react';
import './BurgerMenu.css'; // assuming your CSS file is named BurgerMenu.css

const BurgerMenu = () => {
  const [isOpen, setIsOpen] = useState(false);

  const handleClick = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div className={`burger-menu ${isOpen ? 'open' : ''}`} onClick={handleClick}>
      <svg className="line" viewBox="0 0 20 20">
        <path
          d={isOpen ? 'M 2 2 L 18 18' : 'M 2 18 L 18 2'}
          stroke="#dfc385"
          strokeWidth="1.5"
          strokeLinecap="round"
        />
        <path
          d={isOpen ? 'M 2 18 L 18 2' : 'M 2 2 L 18 18'}
          stroke="#dfc385"
          strokeWidth="1.5"
          strokeLinecap="round"
        />
      </svg>
    </div>
  );
};

export default BurgerMenu;
